._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"174726","type":"CustomJS"},{"attributes":{"source":{"id":"174818"}},"id":"174835","type":"CDSView"},{"attributes":{"dimensions":"width"},"id":"174412","type":"PanTool"},{"attributes":{"toolbar":{"id":"174798"}},"id":"174799","type":"ToolbarBox"},{"attributes":{},"id":"174867","type":"StringFormatter"},{"attributes":{},"id":"174862","type":"StringEditor"},{"attributes":{"axis":{"id":"174404"},"coordinates":null,"group":null,"ticker":null},"id":"174407","type":"Grid"},{"attributes":{},"id":"174870","type":"StringEditor"},{"attributes":{"data":{"datetime":{"__ndarray__":"AACA6NYjdUIAAIAWaiZ1QgAAQHy8JnVCAAAAp+sqdUIAAIBykCt1QgAAwDrRLXVCAABANAkxdUIAAABSqDt1QgAAgB1NPHVCAAAARRhCdUIAAECkokV1QgAAADiISHVCAAAAz9FJdUIAAMCQSk91QgAAAPDUUnVCAADA7HBUdUIAAICAVld1QgAAAHqOWnVCAABAq4VbdUIAAADqJ2
